// src/App.js
import React from 'react';

const LandingPage = () => {
  return (
    <div className="bg-gray-100 min-h-screen flex items-center justify-center">
      <div className="max-w-lg bg-white p-8 rounded shadow-md">
        <h1 className="text-3xl font-semibold mb-4">Welcome to our Landing Page</h1>
        <p className="text-gray-600">
          This is a simple landing page built using React and Tailwind CSS.
        </p>
        <button className="bg-blue-500 hover:bg-blue-600 text-white px-4 py-2 mt-4 rounded">
          Get Started
        </button>
      </div>
    </div>
  );
};

export default LandingPage;
